import React from "react";
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";
import Typography from "@mui/material/Typography";
import Box from "@mui/material/Box";

const Footer = () => {
  return (
    <Box bgcolor="black" color="white" py={3} mt={5}>
      <Container maxWidth="md">
        <Grid container sx={{ whiteSpace: "nowrap", flexWrap: "nowrap" }}>
          {/* Left Column */}
          <Grid item xs={12} sm={6}>
            <Typography variant="body1">Left Column</Typography>
          </Grid>

          {/* Right Column 1 */}
          <Grid item xs={6} sm={3}>
            <Typography variant="body1">Right Column 1</Typography>
          </Grid>

          {/* Right Column 2 */}
          <Grid item xs={6} sm={3}>
            <Typography variant="body1">Right Column 2</Typography>
          </Grid>
        </Grid>
      </Container>
    </Box>
  );
};

export default Footer;
